export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},WdGBZ8oOPt:{data:{id:1906,attributes:{imdbId:"tt0063356",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BYjAyYWJlM2UtZDMyNy00NzdjLWFlMzQtZjQ1MjFkOGJiMmQ2XkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"89%"}],item_lang:{data:{id:2569,attributes:{title:e,plot:"Christopher Gill is a psychopathic killer who uses various disguises to trick and strangle his victims. Moe Brummel is a single and harassed New York City police detective who starts to get phone calls from the strangler and builds a strange alliance as a result. Kate Palmer is a swinging, hip tour guide who witnesses the strangler leaving her dead neighbor's apartment and sets her sights on the detective. Moe's live-in mother wishes her son would be a successful Jewish doctor like his big brother.",slug:"no-way-to-treat-a-lady"}}},books:{data:[{id:9598,attributes:{title:"Which Lie Did I Tell?",description:"From the Oscar-winning screenwriter of All the President's Men, The Princess Bride, and Butch Cassidy and the Sundance Kid, here is essential reading for both the aspiring screenwriter and anyone who loves going to the movies. If you want to know why a no-name like Kathy Bates was cast in Misery, it's in here. Or why Linda Hunt's brilliant work in Maverick didn't make the final cut, William Goldman gives you the straight truth. Why Clint Eastwood loves working with Gene Hackman and how MTV has changed movies for the worse,William Goldman, one of the most successful screenwriters in Hollywood today, tells all he knows. Devastatingly eye-opening and endlessly entertaining, Which Lie Did I Tell? is indispensable reading for anyone even slightly intrigued by the process of how a movie gets made.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=eHgpAgAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:true,published:"2013-12-18",publisher:"Vintage",subtitle:"More Adventures in the Screen Trade"}},{id:9599,attributes:{title:e,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=mPiwAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:f,publisher:a,subtitle:a}},{id:9600,attributes:{title:"Boys & Girls Together No Way To Treat A Lady",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=s35Dv2irDfYC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:f,publisher:a,subtitle:a}},{id:9601,attributes:{title:e,description:"Hayley’s not brave enough to expose her stretch marks to a complete stranger. Then she meets Jed Williams... Treats To Tempt You, Book 5.5 – a sexy short story. Single, over thirty, and with four kids under ten, Hayley’s convinced she won’t be having sex for the next twenty years. Her sister-in-law suggests she have a one night stand, but Hayley’s not brave enough to expose her stretch marks to a complete stranger. Then she meets Jed Williams. After his divorce, Jed’s not actively looking for another relationship, but when Hayley offers a night of hot sex, he’s more than happy to oblige. Their passion grows along with the stormy weather, but when morning breaks, will either of them be brave enough to ask for more? Warning: it’s not only the weather that’s hot and sultry. Adults only! * The correct order of the Treats to Tempt You series is as follows (although the books are all standalones that can be enjoyed in any order): 1: Treat with Caution (Tasha and Kole) 2: Treat her Right (Maisey and Joss) 3: A Rare Treat (Elle and Stuart) 4: Trick or Treat (Fox and Caitlin) 5: A Festive Treat (Skye and Owen) 5.5: No Way to Treat a Lady (Hayley and Jed - novella) 6: A Secret Between Friends (Niall and Genie) 6.5: A Taste of Things to Come (Tasha and Kole - novella) 7: An Ocean Between Us (Danny and Hermione) Keywords: Erotic romance, international location, summer beach holiday or vacation romantic novel, Contemporary friends to lovers in the workplace, Rural small town New Zealand, one night stand affair, comedy and humor with sport hero",thumbnail:a,authors:[c],firstBook:d,published:f,publisher:"Serenity Woods",subtitle:a}},{id:9602,attributes:{title:"The Sundance Kid",description:"Documents the career and contributions of the popular film actor and director, describing his breakout performance in Butch Cassidy and the Sundance Kid, his activist role in support of endangered species conservation, and his relationships with Hollywood contemporaries.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=FYwfGogHRhwC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Lawrence J. Quirk","William Schoell"],firstBook:d,published:"2006-01-01",publisher:"Rowman & Littlefield",subtitle:"An Unauthorized Biography of Robert Redford"}}]}}},meta:{}}},prerenderedAt:1681703530505}}("","movie","William Goldman",null,"No Way to Treat a Lady","1964-01-01","series",1))